import {createBrowserRouter} from "react-router-dom";

import Index from '../screens/index'
import { Layout } from "./Layout";

const rota = createBrowserRouter([
    {
        path: "/",
        element: <Layout><Index /></Layout> ,
    },
]);

export {rota};
